import React, { useState } from 'react';

function ProductDetail() {
    const [provincia, setProvincia] = React.useState([]);

    React.useEffect(()=> {
        const url = 'https://apis.datos.gob.ar/georef/api/provincias?nombre=Ciudad%20Aut%C3%B3noma';        
        fetch(url).then((response)=>{
            if (response.ok){
                return response.json();
            }else {
                throw response;
            }
        })
        .then((data) => setProvincia(data.results))
        .catch((error)=> console.log('No se encontró la ciudad especificada'));
    }, [])
    return(
        <div>
            {provincia?.map(provincia => {
                return(
                    <h5>{provincia.nombre}</h5>
                );
            })}
        </div>

    )
}


export default ProductDetail;
